import React from 'react';

const ProjectCard = ({ project: { id, name, description, owner, contributors } }) => {
    return (
        <div className="project" key={id}>
            <div>
                <h3>{name}</h3>
                <p>{description}</p>
                <p>{owner}</p>
                <p>{contributors}</p>
            </div>
        </div>
    );
}

export default ProjectCard;
